import React from 'react'
import './Header.css';
import logo from "/My project/ca/src/Assets/ca-logo.png";
// import heading from "/My project/ca/src/Assets/cheading.png";


function Header() {
    function animateHamburger() {
        ('#hamburger-button').toggleClass('open');
      /*animation from burger to X*/
      }
      
      function slideMenu(){
        ('.navbar').toggleClass('open');
        /*animation for slide down menu*/
      }
      ('#hamburger-button').click(function(){
        console.log('trying');
        animateHamburger();
        slideMenu(); /*attaching click handler to the burger button*/
      });
    return (
        <div className="header">
            <div className="header__left">
                <div className="header__logo">
                <img src={logo} alt="" />
            </div>

            <div className="header__right">
            <div class='navbar'>
                <ul>
                  <li>item one</li>
                  <li>item pew</li>
                  <li>item three</li>
                  <li>item smores</li>
                </ul>
                </div>

                <div id="hamburger-button">
                        <span></span>
                        <span></span>
                        <span></span>
                </div>
                  <h1>BURGER NAV DEMO1</h1>
                <h2>slide from left + burger to X</h2>



            </div>
            </div>
        </div>
    )
};

export default Header;
